le_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"600759","type":"CustomJS"},{"attributes":{},"id":"600931","type":"StringEditor"},{"attributes":{},"id":"600946","type":"StringFormatter"},{"attributes":{"axis":{"id":"600623"},"coordinates":null,"group":null,"ticker":null},"id":"600626","type":"Grid"},{"attributes":{"fill_color":{"value":"cyan"},"hatch_color":{"value":"cyan"},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":196},"y":{"value":1.6494487752300002}},"id":"600519","type":"Scatter"},{"attributes":{"coordinates":null,"data_source":{"id":"600461"},"glyph":{"id":"600700"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"600702"},"nonselection_glyph":{"id":"600701"},"view":{"id":"600704"}},"id":"600703","type":"GlyphRenderer"},{"attributes":{"editor":{"id":"600931"},"field":"Win Rate [%]","formatter":{"id":"600930"},"title":"Win Rate [%]"},"id":"600875","type":"TableColumn"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"600464"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"600655","type":"Scatter"},{"attributes":{},"id":"600947","type":"StringEditor"},{"attributes":{"tool
